// Default imports
import React, {Component} from 'react';
import Nav from "../navbar/navbar";
import Footer from "../../components/footer/footer";

// Custom imports
import './timeline.css';

class Timeline extends Component {
    renderEvents=()=>{
        return <div className="timeline">
            <div className="timeline-event">
                <div className="card timeline-content">
                    <div className="card-content">
                                    <span className="card-title activator grey-text text-darken-4">Tile<i
                                        className="material-icons right">more_vert</i></span>
                        <p>Content <a href="#">This is a link</a></p>
                    </div>
                    <div className="card-reveal">
                                    <span className="card-title grey-text text-darken-4">Card Title<i
                                        className="material-icons right">close</i></span>
                        <p>Here is some more information about this product that is only revealed once
                            clicked on.</p>
                    </div>
                </div>
                <div className="timeline-badge blue white-text"><i className="material-icons">language</i>
                </div>
            </div>
        </div>
    }
    render() {
        return (
            // HTML here
            <div>
                <Nav/>
                <div className='container'>
                    <div className="section">
                        <div className='row'>
                            <h4>Progress...</h4>
                        </div>
                    </div>
                    <div className="divider"></div>
                    {this.renderEvents()}
                    <Footer/>
                </div>
            </div>
        )
    }
}

// Default export
export default Timeline;
